import React from "react";
import Card from "../components/Card";
import Nav from "../components/Nav";

class Home extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      data: [
        {
          id: 1,
          title: "Monster",
          description: "drink",
          leftColor: "#42FF0E",
          rightColor: "#000002",
          imgIcono:
            "https://www.monsterenergy.com/media/uploads_image/2020/12/02/auto/400/2cd0b187eb3ea28f5250d12fdb4f0988.png?mod=v1_fdbccdc73cd0c96253e6a1a754324fa3",
        },
        {
          id: 2,
          title: "Red Bull",
          description: "drink",
          leftColor: "#D1260A",
          rightColor: "#1B85F0",
          imgIcono:
            "https://cdn.iconscout.com/icon/free/png-512/redbull-282301.png",
        },
        {
          id: 3,
          title: "Brahma",
          description: "drink",
          leftColor: "#000002",
          rightColor: "#D1260A",
          imgIcono:
            "https://image.winudf.com/v2/image/Yml6LmFwcDRtb2JpbGUuYXBwX2U4YzNmZGMxNTRmMDQyNTE4M2JlZmZkODQ3MTkwZmM2LmFwcF9pY29uX29jZWpsa3My/icon.png?w=170&fakeurl=1",
        },
        {
          id: 4,
          title: "Quilmes",
          description: "drink",
          leftColor: "#EBEDF2",
          rightColor: "#1B85F0",
          imgIcono:
            "https://lh3.googleusercontent.com/proxy/FU-BQbElXfWMLWhP3vQPvHcX6MCs6TmFAnBHwvWSbdoXo7HrcbRjquOwqhHnTb0mpDgLCYfR-Zw0JdKIlLif2nnkUF-1j8lvPONbk4JY48vu8kGWvxW5OjIzW_9jHn85OB5swQq6kx-Ey7iX",
        },
      ],
    };
  }

  render() {
    return (
      <div>
        <Nav username="gabriel" />

        {this.state.data.map((card) => {
          return(
            <Card tittle={card.title} 
                  description={card.description} 
                  img={card.imgIcono}
                  leftColor={card.leftColor}
                  rightColor={card.rightColor} 
            />
          )
        })}
      </div>
    );
  }
}

export default Home;
